import { useEffect, useState } from "react";
import axios from "axios";

export default function OrdersPanel() {
  const [orders, setOrders] = useState([]);
  const [filtered, setFiltered] = useState([]);
  const [orderIdSearch, setOrderIdSearch] = useState("");
  const [dateFrom, setDateFrom] = useState("");
  const [dateTo, setDateTo] = useState("");

  useEffect(() => {
    load();
  }, []);

  const load = () => {
    axios.get("http://localhost:5085/api/admin/orders")
      .then(res => {
        setOrders(res.data);
        setFiltered(res.data);
      });
  };

  const handleSearch = () => {
    let result = [...orders];

    if (orderIdSearch.trim()) {
      result = result.filter(o =>
        o.orderId.toString().includes(orderIdSearch.trim())
      );
    }

    if (dateFrom) {
      result = result.filter(o => new Date(o.createdAt) >= new Date(dateFrom));
    }
    if (dateTo) {
      result = result.filter(o => new Date(o.createdAt) <= new Date(dateTo));
    }

    setFiltered(result);
  };

  const handleDelete = async (id) => {
    if (!window.confirm("–£–¥–∞–ª–∏—Ç—å –∑–∞–∫–∞–∑?")) return;
    await axios.delete(`http://localhost:5085/api/admin/orders/${id}`);
    load();
  };

  return (
    <div style={{ maxWidth: "1100px", margin: "0 auto", padding: "30px" }}>
      <h2>üì¶ –ó–∞–∫–∞–∑—ã</h2>

      {/* –ü–æ–∏—Å–∫ */}
      <div style={{ display: "flex", gap: 12, marginBottom: 20 }}>
        <input
          type="text"
          placeholder="–ü–æ–∏—Å–∫ –ø–æ ID –∑–∞–∫–∞–∑–∞..."
          value={orderIdSearch}
          onChange={(e) => setOrderIdSearch(e.target.value)}
        />
        <input type="date" value={dateFrom} onChange={(e) => setDateFrom(e.target.value)} />
        <input type="date" value={dateTo} onChange={(e) => setDateTo(e.target.value)} />
        <button onClick={handleSearch}>üîç –ù–∞–π—Ç–∏</button>
        <button onClick={load}>üîÑ –°–±—Ä–æ—Å</button>
      </div>

      {filtered.map(o => (
        <div key={o.orderId} style={{
          marginBottom: 20,
          padding: 20,
          border: "1px solid #ccc",
          borderRadius: 8,
          backgroundColor: "#f9fafb"
        }}>
          <div><strong>ID:</strong> {o.orderId}</div>
          <div><strong>–î–∞—Ç–∞:</strong> {new Date(o.createdAt).toLocaleString()}</div>
          <div><strong>–ü–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å:</strong> {o.user.username} ({o.user.email})</div>
          <div>
            <strong>–¢–æ–≤–∞—Ä—ã:</strong>
            <ul>
              {o.items.map(i => (
                <li key={i.productId}>
                  {i.model} ‚Äî {i.quantity} √ó {i.price} —Ä—É–±.
                </li>
              ))}
            </ul>
          </div>
          <div><strong>–°—É–º–º–∞:</strong> {o.total} —Ä—É–±.</div>
          <button onClick={() => handleDelete(o.orderId)} style={deleteBtn}>üóë –£–¥–∞–ª–∏—Ç—å</button>
        </div>
      ))}
    </div>
  );
}

const deleteBtn = {
  background: "#ef4444", color: "#fff", border: "none", padding: "8px 12px",
  borderRadius: "6px", cursor: "pointer"
};
